INSERT INTO `variation_study` VALUES (1,'Ewing Sarcoma (Institite Cuire,Cancer Discov 2024)','Ewing sarcoma is a primary bone tumor initiated by EWSR1-ETS gene fusions. To identify secondary genetic lesions that contribute to tumor progression, we performed whole-genome sequencing of 112 Ewing sarcoma samples and matched germline DNA. Overall, Ewing sarcoma tumors had relatively few single-nucleotide variants, indels, structural variants, and copy-number alterations. Apart from whole chromosome arm copy-number changes, the most common somatic mutations were detected in STAG2 (17%), CDKN2A (12%), TP53 (7%), EZH2, BCOR, and ZMYM3 (2.7% each). Strikingly, STAG2 mutations and CDKN2A deletions were mutually exclusive, as confirmed in Ewing sarcoma cell lines. In an expanded cohort of 299 patients with clinical data, we discovered that STAG2 and TP53 mutations are often concurrent and are associated with poor outcome. Finally, we detected subclonal STAG2 mutations in diagnostic tumors and expansion of STAG2-immunonegative cells in relapsed tumors as compared with matched diagnostic samples.','Whole-genome sequencing reveals that the somatic mutation rate in Ewing sarcoma is low. Tumors that harbor STAG2 and TP53 mutations have a particularly dismal prognosis with current treatments and require alternative therapies. Novel drugs that target epigenetic regulators may constitute viable therapeutic strategies in a subset of patients with mutations in chromatin modifiers.','10.1158/2159-8290.CD-14-0622','Lessnick SL, Ladanyi M. Molecular pathogenesis of Ewing sarcoma: new therapeutic and transcriptional targets. Annu Rev Pathol. 2012;7:14559. - PMC - PubMed',1),(2,'Pediatric Ewing Sarcoma (DFCI, Cancer Discov 2014)','Pediatric Ewing sarcoma is characterized by the expression of chimeric fusions of EWS and ETS family transcription factors, representing a paradigm for studying cancers driven by transcription factor rearrangements. In this study, we describe the somatic landscape of pediatric Ewing sarcoma. These tumors are among the most genetically normal cancers characterized to date, with only EWS-ETS rearrangements identified in the majority of tumors. STAG2 loss, however, is present in more than 15% of Ewing sarcoma tumors; occurs by point mutation, rearrangement, and likely nongenetic mechanisms; and is associated with disease dissemination. Perhaps the most striking finding is the paucity of mutations in immediately targetable signal transduction pathways, highlighting the need for new therapeutic approaches to target EWS-ETS fusions in this disease.','We performed next-generation sequencing of Ewing sarcoma, a pediatric cancer involving bone, characterized by expression of EWS-ETS fusions. We found remarkably few mutations. However, we discovered that loss of STAG2 expression occurs in 15% of tumors and is associated with metastatic disease, suggesting a potential genetic vulnerability in Ewing sarcoma.','10.1158/2159-8290.CD-13-1037',NULL,1),(3,'Uveal Melanoma (QIMR, Oncotarget 2016)','Next generation sequencing of uveal melanoma (UM) samples has identified a number of recurrent oncogenic or loss-of-function mutations in key driver genes including: GNAQ, GNA11, EIF1AX, SF3B1 and BAP1. To search for additional driver mutations in this tumor type we carried out whole-genome or whole-exome sequencing of 28 tumors or primary cell lines. These samples have a low mutation burden, with a mean of 10.6 protein changing mutations per sample (range 0 to 53). As expected for these sun-shielded melanomas the mutation spectrum was not consistent with an ultraviolet radiation signature, instead, a BRCA mutation signature predominated. In addition to mutations in the known UM driver genes, we found a recurrent mutation in PLCB4 (c.G1888T, p.D630Y, NM_000933), which was validated using Sanger sequencing. The identical mutation was also found in published UM sequence data (1 of 56 tumors), supporting its role as a novel driver mutation in UM. PLCB4 p.D630Y mutations are mutually exclusive with mutations in GNA11 and GNAQ, consistent with PLCB4 being the canonical downstream target of the former gene products. Taken together these data suggest that the PLCB4 hotspot mutation is similarly a gain-of-function mutation leading to activation of the same signaling pathway, promoting UM tumorigenesis.','While this manuscript was under review, the TCGA UM data were released (11/14/2015), which identified 2/80 samples with mutations in codon p.D630 of PLCB4. Sample TCGA-VD-A8KD carries two mutations at adjacent bases in the same codon, c.G1888T and c.A1889T, which if they are biallelic result in amino acid changes p.D630Y (the same mutation we describe here) and p.D630V, respectively, or if they occur on the same allele translate to p.D630F. Sample TCGA-YZ-A985 carries a c.G1888A mutation resulting in amino acid change p.D630N.','10.18632/oncotarget.6614',NULL,6),(4,'Breast Cancer (MSK, Cancer Cell 2018)','We integrated the genomic sequencing of 1,918 breast cancers, including 1,501 hormone receptor-positive tumors, with detailed clinical information and treatment outcomes. In 692 tumors previously exposed to hormonal therapy, we identified an increased number of alterations in genes involved in the mitogen-activated protein kinase (MAPK) pathway and in the estrogen receptor transcriptional machinery. Activating ERBB2 mutations and NF1 loss-of-function mutations were more than twice as common in endocrine resistant tumors. Alterations in other MAPK pathway genes (EGFR, KRAS, among others) and estrogen receptor transcriptional regulators (MYC, CTCF, FOXA1, and TBX3) were also enriched. Altogether, these alterations were present in 22% of tumors, mutually exclusive with ESR1 mutations, and associated with a shorter duration of response to subsequent hormonal therapies.','We performed prospective sequencing of 1,501 HR+ breast cancers in the clinical setting','10.1016/j.ccell.2018.08.008',NULL,2),(5,'Breast Cancer (MSK, Nature Cancer 2020)','Alpelisib is a selective inhibitor of PI3K, shown to improve outcomes for PIK3CA mutant, hormone receptor positive (HR+) metastatic breast cancers (MBC) when combined with antiestrogen therapy. To uncover mechanisms of resistance, we conducted a detailed, longitudinal analysis of tumor and plasma circulating tumor DNA among such patients from a phase I/II trial combining alpelisib with an aromatase inhibitor (AI) (NCT01870505). The trial\'s primary objective was to establish safety with maculopapular rash emerging as the most common grade 3 adverse event (33%). Among 44 evaluable patients, the observed clinical benefit rate was 52%. Correlating genetic alterations with outcome, we identified loss-of-function PTEN mutations in 25% of patients with resistance. ESR1 activating mutations also expanded in number and allele fraction during treatment and were associated with resistance. These data indicate that genomic alterations that mediate resistance to alpelisib or antiestrogen may promote disease progression and highlight PTEN loss as a recurrent mechanism of resistance to PI3K inhibition.','Taken together, our findings indicate that resistance to alpelisib in combination with aromatase inhibition is a convergent phenotype, and that genetic alterations in components of either the ER or PI3K pathway may be sufficient to promote tumor progression.','10.1038/s43018-020-0047-1',NULL,2),(6,'Metastatic Breast Cancer (MSK, Cancer Discovery 2022)','Cyclin-dependent kinases 4 and 6 (CDK4/6) represent a major therapeutic vulnerability for breast cancer. The kinases are clinically targeted via ATP competitive inhibitors (CDK4/6i); however, drug resistance commonly emerges over time. To understand CDK4/6i resistance, we surveyed over 1,300 breast cancers and identified several genetic alterations (e.g., FAT1, PTEN, or ARID1A loss) converging on upregulation of CDK6. Mechanistically, we demonstrate CDK6 causes resistance by inducing and binding CDK inhibitor INK4 proteins (e.g., p18INK4C). In vitro binding and kinase assays together with physical modeling reveal that the p18INK4C-cyclin D-CDK6 complex occludes CDK4/6i binding while only weakly suppressing ATP binding. Suppression of INK4 expression or its binding to CDK6 restores CDK4/6i sensitivity. To overcome this constraint, we developed bifunctional degraders conjugating palbociclib with E3 ligands. Two resulting lead compounds potently degraded CDK4/6, leading to substantial antitumor effects in vivo, demonstrating the promising therapeutic potential for retargeting CDK4/6 despite CDK4/6i resistance. SIGNIFICANCE: CDK4/6 kinase activation represents a common mechanism by which oncogenic signaling induces proliferation and is potentially targetable by ATP competitive inhibitors. We identify a CDK6-INK4 complex that is resilient to current-generation inhibitors and develop a new strategy for more effective inhibition of CDK4/6 kinases.This article is highlighted in the In This Issue feature, p. 275.','An inducible CDK6INK4 complex blocks drug binding and impairs efficacy for current-generation CDK4/6 inhibitors, but harbors sensitivity to potent CDK4/6 degrader compounds that represent a promising strategy for next-generation cell-cycle inhibitors.',' 10.1158/2159-8290.CD-20-1726',NULL,2);
